import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import "./MyList.css";
import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from "reactstrap";
import GenMeme from "./GenMeme";

class MyList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      modal: false,
      currImg: null,
    };
  }
  render() {
    return (
      <div class="dashboard grid-container col-3">
        <div class="grid-content">
          <ul class="list pos-sticky">
            <div class="list-heading">
              <span>Hello User</span>
              <i class="fa-solid fa-minus"></i>
            </div>
            <li>Create a List</li>
            <li>SHow My List</li>
            <li>
              <button class="btn-secd">Logout</button>
            </li>
          </ul>
        </div>
        <div class="grid-content">
          <h2>Your List</h2>
          <p>You can view your selected memes here</p>
          <div class="flex">
            <div class="card card-horizontal">
              <div class="content-horizontal">
                <img
                  class="card-img"
                  src="https://picsum.photos/500"
                  alt="loading"
                />

                <div class="card-text">
                  <p>
                    Visit ten places on our planet that are undergoing the
                    biggest changes today.
                  </p>
                </div>
              </div>
              <input type="checkbox" name="" id="" />
            </div>
          </div>
        </div>
        <div class="grid-content">
          <GenMeme img={this.state.currImg} />
        </div>
      </div>
    );
  }
}

export default withRouter(MyList);
